import React from "react";
import api from '../api'
import Navbar from '../../components/Navbar'
import './bstest.css';
import { useNavigate } from 'react-router-dom';

const BSTest = () => {
  let [ticker, setTicker] = React.useState('')
  let [country, setCountry] = React.useState('')
  let [quantity, setQuantity] = React.useState('')
  let [price, setPrice] = React.useState('')
  function submitAdd(e) {
    e.preventDefault();
    let text;
    // let quantity;
    // let price;
    // let country;
    // let ticker;   
    //alert("You have updated " + ticker + " (" + country + ") with a quantity value of " + quantity + " at $" + price + " each!");
    alert("Update Succesfull!")
    text = "You have updated " + ticker + " (" + country + ") with a quantity value of " + quantity + " at $" + price + " each!";
    document.getElementById("udAdd").innerHTML = text;
  };

  function handleRemove(e){
    e.preventDefault();
    alert("You have succesfully removed QTY of Ticker @ Price");
  };

  function handleAdd (e){
    e.preventDefault();
    alert("You have succesfully added QTY of Ticker @ Price");
  };

  
    return (
      <div className="Stocks">
        
         <form className="form" onSubmit={submitAdd}> 
         
         <div className="input-group">
            <label htmlFor="ticker">Ticker </label>
            <input required             
            id="ticker" 
            type="ticker" 
            name="ticker" 
            placeholder='Example: AAPL, TSLA'
            value={ticker} 
            onChange={(e) => setTicker(e.target.value)}            
            />
          </div>
          
          <div className="input-group">
            <label htmlFor="Country">Country </label>
            <input             
            id="country" 
            type="country" 
            name="country" 
            placeholder='USD or SGD only'
            required value={country}  
            onChange={(e) => setCountry(e.target.value)}
            />
          </div>        
                   
          <div className="input-group">
            <label htmlFor="quantity">Quantity </label>
            <input required  
            id="quantity" 
            type="quantity" 
            name="quantity" 
            placeholder='Numerical values only' 
            value={quantity}
            onChange={(e) => setQuantity(e.target.value)}
            />
          </div>
          
          <div className="input-group">
            <label htmlFor="price">Price </label>
            <input  required 
            id="price" 
            type="price" 
            name="price" 
            placeholder='Numerical values only' 
            value={price}
            onChange={(e) => setPrice(e.target.value)}
            />
          </div>
         
          <button className="Add">
            Update - Add
          </button>

          <button className="Add">
            Update - Add
          </button>

           <p id="udAdd"></p> 

          </form>

          </div>

          // <button className="Remove">
          //   Update - Remove
          // </button>

          /* <button className="Add" onClick={handleAdd}>
          Update - Add
          </button>
          
          <button className="Remove" onClick={handleRemove}>
          Update - Minus
          </button> */

          //<p id="quantityinput"></p> 

      //     </form>
       
      // </div>
    );
  
}

export default BSTest;
